  const { projectLink, projectImg } = props
  return (
    <a
      href={projectLink}
      className="portfolio__item"
      target="_blank"
      rel="noreferrer">
      <img src={Images} alt="" className="portfolio__img" />
      {/* <img src={`Image.${projectImg}`} alt="" className="portfolio__img" /> */}
    </a>
  )
}
